import { Routes, Route } from 'react-router-dom'
import './App.css';
import Login from "./components/Login"

function App() {

  return (
    <div className="App">
      <main>
        <Link to ="/">Home</Link>
        <Routes>
          <Route path='/' element={<Login/>}/>
        </Routes>
      </main>

    </div>
  );
}

export default App;
